import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(){
    super();

    this.state = {
      houses: [
        {
          name: 'Cumbres III',
          id: '1'
        },
        {
          name: 'Campanario',
          id: '2'
        },
        {
          name: 'Otra casa mas',
          id: '3'
        }
      ]
    };
  }

  render() {
    return (
      <div className="App">
      {this.state.houses.map(house => (
        <h1 key={house.id}> {house.name} </h1>
        ))}
      </div>
    )
  }
}

export default App;
